import React from 'react';

const newblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "1200px",
    height: "600px",
    textAlign: "center",
    marginLeft: "270px",
    marginTop: "40px",
    alignContent: "center"
}

export default class User extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            info: [],
        }
    }

    componentDidMount() {
        fetch('http://localhost:8080/getUser',{
                method:'get'
            })
            .then(results => {
                return results.json();
            }).then(data => {
            let info = data.results.map((uinfo) => {
                return (
                    <div key={uinfo.results}>
                        {uinfo.result}
                    </div>
                )
            })
            this.setState({info: info});
        })
    }

    render() {
        return (
            <div style={newblock}>{this.state.info}</div>
        )
    }

}
